import React from "react";
import "./Home.css";
import Card from "./Card";

function Home(){
    return (
        <div className="home">
            <img className="home__image"
                 src={require("../images/banner.jpg")}
                 alt="" />

            <div className="home__row">
                <Card src={require("../images/jee.webp")}
                      title={"Calculator"}
                      description={"App provides simple mathematical functions in a beautifully designed interface." +
                      "It performs basic calculations such as addition, subtraction, multiplication, and division."}
                      tech_stack={"HTML, CSS, Bootstrap, Javascript."}
                      link={"https://codepen.io/rohit10000/full/GrjJmO"}
                />
                <Card src={require("../images/gate.png")}
                      title={"Calculator"}
                      description={"App provides simple mathematical functions in a beautifully designed interface." +
                      "It performs basic calculations such as addition, subtraction, multiplication, and division."}
                      tech_stack={"HTML, CSS, Bootstrap, Javascript."}
                      link={"https://codepen.io/rohit10000/full/GrjJmO"}
                />
            </div>
            <div className="home__row">
                <Card src={require("../images/upsc.jpeg")}
                      title={"Calculator"}
                      description={"App provides simple mathematical functions in a beautifully designed interface." +
                      "It performs basic calculations such as addition, subtraction, multiplication, and division."}
                      tech_stack={"HTML, CSS, Bootstrap, Javascript."}
                      link={"https://codepen.io/rohit10000/full/GrjJmO"}
                />
                <Card src={require("../images/cat.jpeg")}
                      title={"Calculator"}
                      description={"App provides simple mathematical functions in a beautifully designed interface." +
                      "It performs basic calculations such as addition, subtraction, multiplication, and division."}
                      tech_stack={"HTML, CSS, Bootstrap, Javascript."}
                      link={"https://codepen.io/rohit10000/full/GrjJmO"}
                />
            </div>

        </div>

    );
}

export default Home;
